import React from 'react';
import { Fragment } from 'react/cjs/react.production.min';
import classes from './Header.module.css';

function Header() {
  return {}
  <Fragment>
  <div className={classes.Header}>
  <p className={classes.logo}>Farrago</p>
  <p>Cart</p>
  </div>
  </Fragment>
}

export default Header;
